const create = async (sdk, name, symbol, maxTokens, tokenPrice, maxTokenPurchase, royaltyBPS, metadataURI, metadataRendererInit, vaultDistributionTokenAddress, unlockDate, supports4907) => {
    const encodedMetadata = metadataRendererInit != null
        ? ethers.ethers.utils.AbiCoder.prototype.encode(['string', 'string', 'string'], [
            metadataRendererInit.description,
            metadataRendererInit.imageURI,
            metadataRendererInit.animationURI
        ])
        : [];
    const dcntVaultNFT = await getDCNTVaultNFT(sdk);
    const deployTx = await dcntVaultNFT.create(sdk.contract.address, {
        name,
        symbol,
        maxTokens,
        tokenPrice,
        maxTokenPurchase,
        royaltyBPS,
    }, {
        metadataURI,
        metadataRendererInit: encodedMetadata,
    }, vaultDistributionTokenAddress, unlockDate, supports4907);
    const receipt = await deployTx.wait();
    const nft = receipt.events.find((x) => x.event === 'Create').args.nft;
    const vault = receipt.events.find((x) => x.event === 'Create').args.vault;
    return [
        await getDCNT721A(sdk, nft),
        await getDCNTVault(sdk, vault)
    ];
};
const getDCNTVaultNFT = async (sdk) => {
    const endpoint = sdk.chain.addresses.DCNTVaultNFT;
    return new ethers.ethers.Contract(endpoint, DCNTVaultNFT.abi, sdk.signerOrProvider);
};
